class gCookie{static all(){let t=document.cookie.split("; "),e={};return t.forEach(t=>{let s=t.split("=");e[s[0]]=s[1]}),e}static get(t){return this.all()[t]}static set(t,e){return document.cookie=`${t}=${e}; `,!0}static clean(t){let e=[];return"string"==typeof t?e.push(t):e="object"==typeof t?t:Object.keys(this.all()),e.forEach(t=>{document.cookie=`${t}=; expires=Thu, 01 Jan 1970 00:00:00 UTC`}),!0}}